Here's an example TypeScript code that transforms a map of id to objects into an array of objects and removes those without the 'id' property:

```typescript
interface ObjectWithId {
  id: string;
  [key: string]: any;
}

function transformMapToArray(map: { [id: string]: ObjectWithId }): ObjectWithId[] {
  return Object.values(map).filter((obj) => obj.id !== undefined);
}
```

This code defines an interface `ObjectWithId` that requires an `id` property and any other properties. The `transformMapToArray` function takes a map of id to objects and returns an array of objects. It uses `Object.values` to get an array of all the values in the map, and then filters out any objects that don't have an `id` property.
